import React, { Component , useState ,useRef,useEffect } from "react";
import image from "../assets/loqow.png";
import "./Footer.scss";
import $ from 'jquery';
import { NavLink, withRouter } from "react-router-dom";
import { connect } from "react-redux";
const Footer = ({deletecard}) => {

  const [search, setSearch] = useState("");
  
  const handleChange = (e) => {
    setSearch(e.target.value);
  };

  const handleClick = (e) => {
    deletecard(search);
  };


    return (
      <div className="footer">
        <div className="main">
          <div className="child-one">
            <img src={image} />
            <p>Tel: +994 12 430 49 93</p>
            <p className="line-more">Mail: info@hacklab.az</p>
            <p className="line-less">
              Ünvan: Bakı şəhəri, Atatürk pr. 30A
            </p>
            <span className="right">2021. Bütün hüquqlar qorunur.</span>
          </div>
          <div className="child-two">
            <p className="facebook">
              <a href="/">Ana səhifə</a>
            </p>
            <p className="instagram">
              <a href="/">Layiheler</a>
            </p>
            <p className="linkedin">
              <a href="">Linkedin</a>
            </p>
          </div>
          <div className="child-three">
            <div className="two-two">
              <a href="https://www.facebook.com/hacklabaz" className="home-hov">Facebook</a>
              <a href="#up" className="up">
                Yuxarı qayıt
              </a>
            </div>
       
            <p>
              <a href="https://www.instagram.com/hacklabaz/" className="faq-hover">Instagram</a>
            </p>
            <p>
              <a href="https://www.linkedin.com/company/hacklabaz" className="faq-hover">Linkedin</a>
            </p>
            <div className="search-icon">
              <input type="text" onChange={handleChange}  id="search_text" placeholder="Axtar" />
              <div class="fa-search1"  onClick={handleClick}>
                <img src="https://i.ibb.co/Yjc7Q3K/Whats-App-Image-2021-10-29-at-14-25-33-removebg-preview.png" />
              </div>
            </div>
            <div className="end">site by: ZOOM Agency</div>
          </div>
        </div>
      </div>
    );
  
}

const mapDispatchToProps = (dispatch) => {
  return {
    deletecard: (search) => {
      dispatch({ type: "DELETE_CARD", id: search });
    }
  };
};



export default connect(null, mapDispatchToProps)(Footer)
